import React from 'react'
import './Pages.css';

function Home() {
  return (
    <div className='home'>
      <video className='home-vid' width="800" height="500">
        <source src='/public/vid1.mp4' type='video/mp4'/>
      </video>
    </div>
  )
}

export default Home
